import React, { useState, useEffect } from 'react';

function Game(){
    const [boxLimit, setBoxLimit] = useState([]);

    useEffect(()=> {
        const arr =[];
        for(let i=1; i<= 60; i++){
            arr[i]=i;
        }
        setBoxLimit(arr);
    },[])

    return (
        <div>
            <div className="ui_grid">
                {boxLimit.map(box => <div className="box" id={box} key ={box}>
                            <div className={`cell${box}`}>{box} </div>
                        </div>)}
            </div>
            <button className="button_left">left</button>
            <button className="button_right">right</button>
            <button className="button_up">up</button>
            <button className="button_down">down</button>
        </div>
        
    );
}


export default Game;
